column2:
 "text": "원래 기대 1도 없어서 여론이나 보려고 봤는데;;;;;;
와 생각보다 심각하네 ㄷㄷ
근데 요즘 중국집들은 물가가 올라서 그런지  1만원 이하 음식들은 그냥 맛 포기하고 먹어야 하는 수준.
우리 한식이 워낙 노동력 착취급의 음식이기도 하고
그 앞세대들은 떠나고 이어 받는 세대가 그대로 할 생각은 없고
그렇다고 그 걸 이해해 주는 문화는 아직 아니고;;;;;
한동안 계속 시끄러운 곳이 될듯;;;;;
1만원 넘게 지불해야 하는 짬뽕 먹으면 예전 먹던 그 맛이 있음ㅎㅎㅎ(이게 맞을지도;;;;)"

 "text": "그래서 백종원씨는 지금 까지 뭐하셨어요? 
이런 영상 올리면 뭐 사람들이 같이 응원 해줄주 알았나 이해가 안가네;;; 

방송 좀 그만하시고 더본 코리아 가맹점들 교육이나 제대로 시키시고 다니시길 😊"
